function Obj(params) {
    const arr = ['a', 'b', 'a']
    let memory = {}
    const countElement = (arr) => {
        for (let index = 0; index < arr.length; index++) {
            const element = arr[index];
            if (memory[element]) {
                memory[element] = memory[element] + 1
            } else {
                memory[element] = 1
            }

        }
        //  console.log(memory)
    }
    countElement(arr)
    const Obj1 = {
        name: 'b',
        data: {}
    }
    const Obj2 = {
        name: 'b',
        data: {}
    }
    let string = JSON.stringify(Obj1) === JSON.stringify(Obj2)
    // console.log(JSON.parse(string))
    // console.log(typeof(string))

    function printData(params) {
        const Obj4 = {
            data: [],
            pushData: function () {
                //   this.data.push(0,1,2,3)
                for (let index = 0; index < 4; index++) {
                    this.data.push(index)

                }
            },
            getData: function () {
                return this.data
            },
        }
        Obj4.pushData()
        const newData = Obj4.getData()
        return newData
    }
    const data = printData()
    // console.log(data)

    const arry = [{ id: '1', age: '50' }, { id: '2', age: '60' }, { id: '3', age: '70' },]
    const ages = [60, 70]
    function filterArry() {
     const newarr= arry.filter((item)=>{
         for (let index = 0; index < ages.length; index++) {
            const element = ages[index];
            if (+item.age===element) {
              return item
            }
         }
      })
      console.log(newarr)
    }
   filterArry()
  
   
    return <div>

    </div>
}
export default Obj
